import React from 'react';


class PollsAsideButtons extends React.Component {

    constructor(props) {
        this.props = props;
    }

    render() {
        return <article data-name={this.props.viewName}>
            <span class="sidebar-icon" style={{backgroundImage: url(`${this.props.viewImage}`)}}></span>
            <span class="sidebar-label non-select">{this.props.buttonSign}</span>
        </article>
    }

}

export { PollsAsideButtons }
